import React from "react";

import classes from "./Button.module.css";

const button = (props) => {
  return (
    <button
      onClick={props.clicked}
      className={[classes.Button, classes[btnType]].join(" ")}
    >
      {props.children}
    </button>
  );
};

export default button;
